import React, { Fragment } from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";
import "react-bubble-ui/dist/index.css";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <Fragment>
    <div>
    {data.map((item) => item.id == id && <h3 className="card__description" key={id}>{item.description}</h3>)}
    </div>
    <div>
    <table id="customers">
      <tr>
        <th>Id</th>
        <th>Title</th>
        <th>Website</th>
      </tr>
      {data.map((item) => item.id == id && item.datas.map((a) => <tr className="card__item" key={a.id}>
          <td>{a.id}</td>
          <td><a href={`${a.link}`}>{a.title}</a></td>
          <td><a href={`${a.link}`}>Link to website</a></td>
        </tr>))}
    </table>
    </div>
    </Fragment>
  );
};
